('11','3','疫苗微店（测试）','','0','0','1、营养全面，适口性好，易吸收。\r\n2、促进快速生长，是体重均匀一致，达到品种要求体重。\r\n3、只有加强饲养管理，提供鸡生长发育的良好环境，才能获得理想的饲喂效果和经济效益。\r\n4、特殊营养可以降低腿部疾病，保证鸡群健康。','2','0','0','http://7xosf8.com1.z0.glb.clouddn.com/EUUUN3iYUuiyznVhnUbTotlU66mLOn.jpg','','1'),
