('13','3','养殖器械微店（测试）','','0','0','1、本品营养丰富合理，为鹅各个生理阶段提供更为贴切的营养，饲料利用率高、生长快、产蛋多；\r\n2、强化药物组合，能有效增强机体免疫力，并添加了抗球虫药，无需另加抗球虫药；\r\n\r\n3、显著改善蛋形、蛋壳质量和色泽，明显提高种蛋受精率，孵化率，出雏率；\r\n4、有效预防雏鹅啄羽啄肛和掉毛等现象。','1','0','0','http://7xosf8.com1.z0.glb.clouddn.com/QtGQ099dqukG49w9hGkyUuHu99K9dk.jpg','','1'),
('15','3','兽药微店','','0','0','产品特点：\r\n  1、采用最新净能体系和可消化理想氨基酸平衡理论的全新概念产品 ，为仔猪提供更为贴切的营养。\r\n  2、采用膨化豆粕为基础原料，添加符合乳猪生理特点的多种复合酸化剂，弥补乳猪胆酸和消化酶的分泌不足，有利于增加仔猪采食量。\r\n  3、添加特殊饲料原料、电解质及天然免疫物质来代替抗生素，从根本上建立强大的疾病防御体系，能有效防止仔猪下痢。\r\n  4、高含量乳糖和脂肪，为仔猪提供更加充足的能量来源，可显著提高仔猪断奶重。\r\n  5、根据仔猪生理特征和仔猪酶系发育特性，添加外源性复合酶，有效增加饲料消化吸收率！\r\n  6、   优化药物组合，提高猪只抗病力和抗应激能力。非抗生素处理，有效防止黄白痢和腹泻症及断奶后下痢，减少死亡。显著提高仔猪成活率。\r\n  7、绿色环保，无激素、无毒素、无污染，能明显降低氨、氮的排放量和粪便气味。','3','0','0','http://7xosf8.com1.z0.glb.clouddn.com/TACSMSCawsx9X99xM9ZW9Ncm0ZsSxW.jpg','','1'),
