('15','3','19','20','1','1','100','乳猪高档教槽料','images/3/2016/01/tK612e3bZ2SYbJEOJYPyd6Ibqbik9p.jpg','袋','','<p><span style=\";font-family:宋体;color:rgb(255,0,0);font-size:14px\">仔猪前期配合饲料（<span style=\"font-family:Times New Roman\">4225</span><span style=\"font-family:宋体\">）</span></span></p><p><span style=\"font-family: 宋体;font-size: 14px\">一、原料组成：</span></p><p><span style=\"font-family: 宋体;font-size: 14px\">进口超级蒸汽鱼粉、全脂奶粉、进口乳清粉、优质膨化玉米、全脂膨化大豆、优质发酵豆粕、柠檬酸钙、磷酸二氢钙、有机微量元素、碘化食盐、优质复合维生素、葡萄糖、赖氨酸、蛋氨酸、苏氨酸、色氨酸、诱食剂、饲料保鲜剂等。</span></p><p><span style=\"font-family: 宋体;font-size: 14px\">二、产品特点：</span></p><p><span style=\"font-family: 宋体;font-size: 14px\">1、爱吃：配有三星好妈妈，诱食性极佳、<span style=\"font-family:Times New Roman\">3</span><span style=\"font-family:宋体\">天即可教槽。</span></span></p><p><span style=\"font-family: 宋体;font-size: 14px\">2、不拉稀：源自欧美最新的养猪技术、采用优质的无抗原饲料原料、添加酶制剂、有机酸化剂、抗菌肽等，再加上独特的二次粉碎、制粒工艺，达到抗拉稀的效果。</span></p><p><span style=\"font-family: 宋体;font-size: 14px\">3、断奶不掉膘：吃得多，不拉稀，肠道好，<span style=\"font-family:Times New Roman\">42</span><span style=\"font-family:宋体\">日龄单窝平均体重达到</span><span style=\"font-family:Times New Roman\">25</span><span style=\"font-family:宋体\">斤。</span></span></p><p><span style=\"font-family: 宋体;font-size: 14px\">三、产品营养含量：</span></p><table><tbody><tr class=\"firstRow\"><td style=\"padding: 0px 7px;border: 1px solid rgb(221, 221, 221);\" valign=\"center\"><p style=\"text-align:center\"><span style=\"font-family: 宋体;font-size: 12px\">使用阶段</span></p></td><td style=\"padding: 0px 7px;border: 1px solid rgb(221, 221, 221);\" valign=\"center\"><p style=\"text-align:center\"><span style=\"font-family: 宋体;font-size: 12px\">粗蛋白质</span></p></td><td style=\"padding: 0px 7px;border: 1px solid rgb(221, 221, 221);\" valign=\"center\"><p style=\"text-align:center\"><span style=\"font-family: 宋体;font-size: 12px\">粗纤维</span></p></td><td style=\"padding: 0px 7px;border: 1px solid rgb(221, 221, 221);\" valign=\"center\"><p style=\"text-align:center\"><span style=\"font-family: 宋体;font-si