('17','3','19','20','1','1','94','4%小猪预混料','images/3/2016/01/PYRoXOxQvJgO8kjot1XtmTyg8T0TTo.jpg','袋','','<p><span style=\"font-family: 宋体;font-size: 14px\">一、</span><span style=\"font-family: 宋体;font-size: 14px\">原料组成：</span></p><p><span style=\"font-family: 宋体;font-size: 14px\">进口诱食剂、半胱胺、生长激素激发因子、中枢采食调控剂、磷酸氢钙、石粉、食盐、赖氨酸、蛋氨酸、色氨酸、氯化胆碱、微生素<span style=\"font-family:Times New Roman\">A</span><span style=\"font-family:宋体\">、微生素</span><span style=\"font-family:Times New Roman\">D</span><span style=\"font-family:宋体\">、维生素</span><span style=\"font-family:Times New Roman\">E</span><span style=\"font-family:宋体\">、维生素</span><span style=\"font-family:Times New Roman\">K</span><span style=\"font-family:宋体\">、叶酸、烟酸、</span><span style=\"font-family:Times New Roman\">D-</span><span style=\"font-family:宋体\">泛酸钙、生物素、硫酸铜、硫酸锌、硫酸亚铁、硫酸锰、亚硒酸钠、碘酸钙、氯化钴、硫酸钠、抗氧化剂、植酸酶、复合酶等。</span></span></p><p><span style=\"font-family: 宋体;font-size: 14px\">二、</span><span style=\"font-family: 宋体;font-size: 14px\">产品特点：</span></p><p><span style=\"font-family: 宋体;font-size: 14px\">1、</span><span style=\"font-family: 宋体;font-size: 14px\">吃的多：本品通过产品天然诱食和中枢诱食的双重途径具有上料快，<span style=\"font-family:Times New Roman\">3-5</span><span style=\"font-family:宋体\">天后极显著提高猪生长速度，日采食量可提高</span><span style=\"font-family:Times New Roman\">15-30%</span><span style=\"font-family:宋体\">。</span></span></p><p><span style=\"font-family: 宋体;font-size: 14px\">2、</span><span style=\"font-family: 宋体;font-size: 14px\">长得快：高水平的氨基酸、维生素等显著提高猪生长速度，日增重比普通预混料提升<span style=\"font-family:Times New Roman\">100-150</span><span style=\"font-family:宋体\">克</span><span style=\"font-family:Times New Roman\">/</span><span style=\"font-family:宋体\">天，仔猪</span><span style=\"font-family:Times New Roman\">30-80kg</span><span style=\"font-family:宋体\">阶段日增重</span><span style=\"font-family:Times New Roman\">850</span><span style=\"font-family:宋体\">克，料重比</span><span style=\"font-family:Times New Roman\">2.2:1</span><span style=\"font-family:宋体\">左右。</span></span></p><p