('19','3','19','20','1','1','98','8%小猪预混料','images/3/2016/01/D70Xg37YfgGSYsOROlngkLr7GvG7g0.jpg','袋','','<p><span style=\"font-family: 宋体;font-weight: bold;font-size: 14px\">仔猪后期复合预混合饲料（<span style=\"font-family:Times New Roman\">802</span><span style=\"font-family:宋体\">，</span><span style=\"font-family:Times New Roman\">8%</span><span style=\"font-family:宋体\">）</span></span></p><p><span style=\"font-family: 宋体;font-size: 14px\">产品特征：</span></p><p><span style=\"font-family: 宋体;font-size: 14px\">1、</span><span style=\"font-family: 宋体;font-size: 14px\">高能量，高氨基酸，低豆粕。</span></p><p><span style=\"font-family: 宋体;font-size: 14px\">2、</span><span style=\"font-family: 宋体;font-size: 14px\">强化维生素，阴阳离子、氨基酸平衡，可显著改善猪只体型，皮嫩毛亮；显著提高猪只日增重。在良好的饲养管理条件小，<span style=\"font-family:Times New Roman\">150</span><span style=\"font-family:宋体\">日龄即可出栏，料肉比</span><span style=\"font-family:Times New Roman\">2.4-2.7:1</span><span style=\"font-family:宋体\">，并能获得良好的体型。</span></span></p><p><span style=\"font-family: 宋体;font-size: 14px\">3、</span><span style=\"font-family: 宋体;font-size: 14px\">阶段划分科学，更符合现代猪种的生长发育特点。</span></p><p><span style=\";font-family:宋体;font-size:14px\">4、<span style=\"font-family:宋体\">添加微生态活菌制剂和功能性添加剂，提高猪只抗病力。</span></span></p><p><span style=\"font-family: 宋体;font-size: 14px\">5<span style=\"font-family:宋体\">、绿色环保、无激素、无毒素、无污染，能明显降低氨、氮的排放量。</span></span></p><p><span style=\"font-family: 宋体;font-size: 14px\">参考配方：</span></p><table><tbody><tr style=\"height:21px\" class=\"firstRow\"><td valign=\"center\" style=\"padding: 0px 7px;border: 1px solid rgb(221, 221, 221);\"><p style=\"text-align:center\"><span style=\"font-family: 宋体;font-size: 14px\">饲养名称</span></p></td><td valign=\"center\" style=\"padding: 0px 7px;border: 1px solid rgb(221, 221, 221);\"><p style=\"text-align:center\"><span style=\"font-family: 宋体;font-size: 14px\">适用阶段</span></p></td><td valign=\"center\" style=\"padding: 0px 7px;border: 1px solid rgb(221, 221, 221);\"><p style=\"text-align:center\"><span style=\"font-f