('32','3','19','20','1','1','82','“好妈妈”人工乳','images/3/2016/03/ua0fJhvJBfvBEA0TA3F1gGA6fhexAe.jpg','袋','','<p><span style=\";font-family:宋体;color:rgb(255,0,0);font-size:14px\">“好妈妈”人工乳</span></p><p><span style=\"font-family: 宋体;font-size: 14px\">使用对象：</span></p><p><span style=\"font-family: 宋体;font-size: 14px\">1、</span><span style=\"font-family: 宋体;font-size: 14px\">母猪死亡或母猪发生疾病（乳房炎，子宫内膜炎，无乳综合征）的乳猪。</span></p><p><span style=\"font-family: 宋体;font-size: 14px\">2、</span><span style=\"font-family: 宋体;font-size: 14px\">患病的幼畜及出生弱仔猪。</span></p><p><span style=\"font-family: 宋体;font-size: 14px\">3、</span><span style=\"font-family: 宋体;font-size: 14px\">母猪产仔过多（达<span style=\"font-family:Times New Roman\">10</span><span style=\"font-family:宋体\">头以上）或母猪奶水不足，体弱母猪的乳猪。</span></span></p><p><span style=\"font-family: 宋体;font-size: 14px\">4、</span><span style=\"font-family: 宋体;font-size: 14px\">断奶前后出现拉稀，掉膘的乳猪。</span></p><p><span style=\"font-family: 宋体;font-size: 14px\">5、</span><span style=\"font-family: 宋体;font-size: 14px\">提早教槽、过渡乳猪教槽料（<span style=\"font-family:Times New Roman\">5-7</span><span style=\"font-family:宋体\">日龄进行过渡颗粒或自配乳猪料）的乳猪。</span></span></p><p><span style=\"font-family: 宋体;font-size: 14px\">6、</span><span style=\"font-family: 宋体;font-size: 14px\">提早断奶（<span style=\"font-family:Times New Roman\">14-21</span><span style=\"font-family:宋体\">日龄断奶）的乳猪。</span></span></p><p><span style=\"font-family: 宋体;font-size: 14px\">7、</span><span style=\"font-family: 宋体;font-size: 14px\">分娩后泌乳少或无乳的哺乳母猪。</span></p><p><span style=\"font-family: 宋体;font-size: 14px\">8、</span><span style=\"font-family: 宋体;font-size: 14px\">猫狗等家庭宠物，奶水不够吃。</span></p><p><span style=\"font-family: 宋体;font-size: 14px\">9、</span><span style=\"font-family: 宋体;font-size: 14px\">羊羔、狐、豹、兔等经济作物。</span></p><p><span style=\"font-family: 宋体;font-size: 14px\">使用方法与用量：</span></p><p><span style=\"font-family: 宋体;font-size: 14px\">1、</span><span style=\"font-family: 宋体;font-size: 14px\">干喂：直接饲喂。</span></p><p><span style=\"font-family: 宋体;font-size: 14px\">2、</span><span style=\"font-family: 宋体;font-size: 14px\">温水泡开后饲喂：温开水泡成牛奶状：<span style=\"font-family:Times New Roman\">1</span><span style=\"font-family:宋体\">份好妈妈用</span><span style=\"font-family:Times New Roman\">6-9</span><span style=\"font-family:宋体\">份</span><span style=\"font-family:Times New Roman\">30-40</span></span><span style=\"font-family: 宋体;font-size: 14px\">℃温开水（不可用凉水）冲泡于奶瓶中饲喂，第一次5ml，第二次10ml，第三次10-15ml,以后都在15ml以内。一般3-4次即可改成干喂。</span></p><p><span style=\"font-family: 宋体;font-size: 14px\">3、</span><span style=\"font-family: 宋体;font-size: 14px\">母猪泌乳少，喂母猪好妈妈2次/天，50-100克/次，连喂三天即可提高母猪的泌乳量。</span></p><p><span style=\"font-family: 宋体;font-size: 14px\">4、</span><span style=\"font-family: 宋体;font-size: 14px\">防止仔猪断奶综合症发生：每包好妈妈拌10-20公斤乳猪料，可提高适口性，防掉膘、抗拉稀、促生长。</span></p><p><span style=\"font-family: 宋体;font-size: 14px\">5、</span><span style=\"font-family: 宋体;font-size: 14px\">饲喂时可先诱食，第一次<span style=\"font-family:Times New Roman\">3-4</span><span style=\"font-family:宋体\">匙涂抹母猪乳头，引诱乳猪；第二次用低食槽饲喂，慢慢用固定小槽转大槽。</span></span></p><p><span style=\"font-family: 宋体;font-size: 14px\">6、</span><span style=\"font-family: 宋体;font-size: 14px\">少量多餐，每日<span style=\"font-family:Times New Roman\">5-6</span><span style=\"font-family:宋体\">次，连用好妈妈</span><span style=\"font-family:Times New Roman\">3-4</span><span style=\"font-family:宋体\">天后可逐渐过渡到使用乳猪配合饲料。</span></span></p><p><span style=\"font-family: 宋体;font-size: 14px\">过渡方法：过渡一定要<span style=\"font-family:Times New Roman\">3-4</span><span style=\"font-family:宋体\">天；第一天</span><span style=\"font-family:Times New Roman\">3</span><span style=\"font-family:宋体\">份好妈妈</span><span style=\"font-family:Times New Roman\">1</span><span style=\"font-family:宋体\">份乳猪料；第二天</span><span style=\"font-family:Times New Roman\">2</span><span style=\"font-family:宋体\">份好妈妈</span><span style=\"font-family:Times New Roman\">2</span><span style=\"font-family:宋体\">份乳猪料；第三天</span><span style=\"font-family:Times New Roman\">1</span><span style=\"font-family:宋体\">份好妈妈</span><span style=\"font-family:Times New Roman\">3</span><span style=\"font-family:宋体\">份乳猪料；第四天可全部使用乳猪配合饲料。</span></span></p><p><span style=\"font-family: 宋体;font-size: 14px\">功效：</span></p><p><span style=\"font-family:宋体;font-size:14px\">1、</span><span style=\";font-family:宋体;font-size:14px\">仔猪提早断奶<span style=\"font-family:Times New Roman\">3-5</span><span style=\"font-family:宋体\">天，提高母猪的利用率。</span></span></p><p><span style=\"font-family:宋体;font-size:14px\">2、</span><span style=\";font-family:宋体;font-size:14px\">提高乳猪存活率，平均<span style=\"font-family:Times New Roman\">10</span><span style=\"font-family:宋体\">头</span><span style=\"font-family:Times New Roman\">/</span><span style=\"font-family:宋体\">窝可多活</span><span style=\"font-family:Times New Roman\">1-2</span><span style=\"font-family:宋体\">头以上。</span></span></p><p><span style=\"font-family:宋体;font-size:14px\">3、</span><span style=\";font-family:宋体;font-size:14px\">可让仔猪断奶期间保持正常采食量，达到仔猪断奶不断食，肠绒毛不萎缩，避免下痢和掉膘。</span></p><p><span style=\"font-family:宋体;font-size:14px\">4、</span><span style=\";font-family:宋体;font-size:14px\">保护肠道有益菌菌群结构和酶活，加速仔猪生长，对病、弱仔猪达保健作用，防止僵猪出现。</span></p><p><span style=\";font-family:宋体;font-size:14px\">保质期：八个月</span></p><p><span style=\"font-family: 宋体;font-size: 14px\">营养成份分析值：</span></p><table><tbody><tr style=\"height:6px\" class=\"firstRow\"><td style=\"padding: 0px 7px;border: 1px solid rgb(221, 221, 221);\" valign=\"center\"><p style=\"text-align:center\"><span style=\"font-family: 宋体;font-size: 12px\">粗蛋白质</span></p></td><td style=\"padding: 0px 7px;border: 1px solid rgb(221, 221, 221);\" valign=\"center\"><p style=\"text-align:center\"><span style=\"font-family: 宋体;font-size: 12px\">粗纤维</span></p></td><td style=\"padding: 0px 7px;border: 1px solid rgb(221, 221, 221);\" valign=\"center\"><p style=\"text-align:justify;text-justify:inter-ideograph\"><span style=\"font-family: 宋体;font-size: 12px\">&nbsp;粗灰粉</span></p></td><td style=\"padding: 0px 7px;border: 1